import { Button } from "@mui/material";
import deliverLogoDBG from "../assets/deliverLogo_DBG.png";

const SideBar = () => {
  const customerSideOptions = [
    {
      name: "주문목록",
      link: "/customer/home",
    },
    {
      name: "물품조회",
      link: "/customer/orders",
    },
    {
      name: "배송상태조회",
      link: "/customer/profile",
    },
  ];

  return (
    <div class="bg-backgroundBlue w-1/6 h-screen flex flex-col items-center py-8 gap-4">
      <img src={deliverLogoDBG} alt="logo" class="w-32" />
      <div class="font-bold text-blueLight">CUSTOMER1</div>

      <div></div>
    </div>
  );
};
export default SideBar;
